pragma solidity 0.8.7;

import "./base/CommonBudgetApproval.sol";
import "./lib/BytesLib.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "./base/PriceResolver.sol";

import "./interface/IBudgetApprovalExecutee.sol";
import "./interface/IDao.sol";
import "./interface/IAdam.sol";
import "hardhat/console.sol";

contract TransferLiquidERC20BudgetApproval is CommonBudgetApproval, PriceResolver {
    using BytesLib for bytes;

    string public constant override name = "Transfer Liquid ERC20 Budget Approval";

    bool public allowAllAddresses;
    mapping(address => bool) public addressesMapping;
    address[] public tokens;
    mapping(address => bool) public tokensMapping;
    bool public allowAnyAmount;
    uint256 public totalAmount;
    uint8 public amountPercentage;

    function initialize(
        InitializeParams calldata params,
        bool _allowAllAddresses,
        address[] memory _toAddresses,
        address[] memory _tokens,
        bool _allowAnyAmount,
        uint256 _totalAmount,
        uint8 _amountPercentage,
        address _baseCurrency
    ) public initializer {
        __BudgetApproval_init(params);

        allowAllAddresses = _allowAllAddresses;
        for(uint i = 0; i < _toAddresses.length; i++) {
            _addToAddress(_toAddresses[i]);
        }
        for(uint i = 0; i < _tokens.length; i++) {
            _addToken(_tokens[i]);
        }

        allowAnyAmount = _allowAnyAmount;
        totalAmount = _totalAmount;
        amountPercentage = _amountPercentage;
        __PriceResolver_init(_baseCurrency);
    }

    function executeParams() public pure override returns (string[] memory) {
        string[] memory arr = new string[](3);
        arr[0] = "address token";
        arr[1] = "address to";
        arr[2] = "uint256 value";
        return arr;
    }

    function _execute(
        uint256 transactionId, 
        bytes memory data
    ) internal override {
        (address token, address to, uint256 value) = abi.decode(data,(address, address, uint256));
        uint256 amountInBaseCurrency;

        if (token == ETH_ADDRESS) {
            IBudgetApprovalExecutee(executee).executeByBudgetApproval(to, "", value);
        } else {
            bytes memory executeData = abi.encodeWithSelector(IERC20.transfer.selector, to, value);
            IBudgetApprovalExecutee(executee).executeByBudgetApproval(token, executeData, 0);
        }

        amountInBaseCurrency = assetBaseCurrencyPrice(token, value);
        require(allowAllAddresses || addressesMapping[to], "Recipient not whitelisted in budget");
        require(tokensMapping[token], "Token not whitelisted in budget");
        require(allowAnyAmount || amountInBaseCurrency <= totalAmount, "Exceeded max budget transferable amount");
        require(checkAmountPercentageValid(amountInBaseCurrency), "Exceeded max budget transferable percentage");

        if(!allowAnyAmount) {
            totalAmount -= amountInBaseCurrency;
        }
    }

    function checkAmountPercentageValid(uint256 amount) internal view returns (bool) {
        if (amountPercentage == 100) return true;

        uint256 _totalAmount = amount;

        for (uint i = 0; i < tokens.length; i++) {
            if (tokens[i] == Denominations.ETH) {
                _totalAmount += assetBaseCurrencyPrice(Denominations.ETH, executee.balance);
            }else {
                _totalAmount += assetBaseCurrencyPrice(tokens[i], IERC20(tokens[i]).balanceOf(executee));
            }
        }

        if (_totalAmount == 0) return false;

        return amount <= _totalAmount * amountPercentage / 100;
    }

    function _addToken(address token) internal {
        require(!tokensMapping[token], "Duplicated Item in source token list.");
        require(canResolvePrice(token), "Unresolvable token in target token list.");

        tokens.push(token);
        tokensMapping[token] = true;
        emit AllowToken(token);
    }

    function _addToAddress(address to) internal {
        require(!addressesMapping[to], "Duplicated address in target address list");
        addressesMapping[to] = true;
        emit AllowAddress(to);

    }


}","keccak256":"0x6181d113f0890b0f122ccac894ac0032b2376a084068ff3afc82a17daa27a22b","license":"GPL-3.0"},"contracts/base/CommonBudgetApproval.sol":{"content":"// SPDX-License-Identifier: GPL-3.0

pragma solidity 0.8.7;

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

import "../lib/BytesLib.sol";
import "../lib/RevertMsg.sol";

import "../interface/IMembership.sol";
import "../interface/ITeam.sol";
import "../interface/IBudgetApprovalExecutee.sol";

abstract contract CommonBudgetApproval is Initializable, UUPSUpgradeable {

    using Counters for Counters.Counter;
    using BytesLib for bytes;

    enum Status {
        Pending,
        Approved,
        Completed,
        Cancelled
    }

    struct Transaction {
        uint256 id;
        bytes[] data;
        Status status;
        uint256 deadline;
        mapping(address => bool) approved;
        uint256 approvedCount;
        bool isExist;
    }

    event CreateTransaction(uint256 id, bytes[] data, uint256 deadline, Status status);
    event ApproveTransaction(uint256 id, address approver);
    event ExecuteTransaction(uint256 id, bytes[] data, address executor);
    event RevokeTransaction(uint256 id);
    event AllowAddress(address target);
    event AllowToken(address token);
    event AllowAmount(uint256 amount);
    event SetApprover(address approver);

    Counters.Counter private _transactionIds;

    mapping(uint256 => Transaction) public transactions;

    address constant public ETH_ADDRESS = 0xEeeeeEeeeEeEeeEeEeEeeEEEeeeeEeeeeeeeEEeE;

    address public executor;
    uint256 public executorTeamId;
    address payable public dao;
    address public executee; // Must be BudgetApprovalExecutee

    mapping(address => bool) public approversMapping;
    uint256 public approverTeamId;
    uint256 public minApproval;

    string public text;
    string public transactionType;

    bool public allowUnlimitedUsageCount;
    uint256 public usageCount;

    uint256 public startTime;
    uint256 public endTime;

    address public team;

    modifier onlyApprover() {
        require(
          approversMapping[msg.sender] ||
          ITeam(team).balanceOf(msg.sender, approverTeamId) > 0, "Approver not whitelisted in budget"
        );
        _;
    }

    modifier onlyExecutor() {
        require(msg.sender == executor ||
          ITeam(team).balanceOf(msg.sender, executorTeamId) > 0, "Executor not whitelisted in budget"
        );
        _;
    }

    modifier onlyExecutee() {
        require(msg.sender == executee, "Executee not whitelisted in budget");
        _;
    }

    modifier matchStatus(uint256 id, Status status) {
        require(transactions[id].status == status, "Transaction status invalid");
        _;
    }

    modifier checkTime(uint256 id) {
        require(block.timestamp <= transactions[id].deadline, "Transaction expired");
        require(block.timestamp >= startTime, "Budget usage period not started");
        if(endTime != 0) {
            require(block.timestamp < endTime, "Budget usage period has ended");
        }
        _;
    }

    struct InitializeParams {
        address dao;
        address executor;
        uint256 executorTeamId;
        address[] approvers;
        uint256 approverTeamId;
        uint256 minApproval;
        string text;
        string transactionType;
        uint256 startTime;
        uint256 endTime;
        bool allowUnlimitedUsageCount;
        uint256 usageCount;
        address team; // TODO: Get team from IBudgetApprovalExecutee
    }

    function __BudgetApproval_init(
        InitializeParams calldata params
        ) internal onlyInitializing {
        dao = payable(params.dao);
        executee = msg.sender;
        executor = params.executor;
        text = params.text;
        transactionType = params.transactionType;

        for (uint i = 0; i < params.approvers.length; i++) {
            approversMapping[params.approvers[i]] = true;
            emit SetApprover(params.approvers[i]);
        }

        minApproval = params.minApproval;
        require(
          params.approverTeamId > 0 || (minApproval <= params.approvers.length),
          "Invalid approver list"
        );

        startTime = params.startTime;
        endTime = params.endTime;

        allowUnlimitedUsageCount = params.allowUnlimitedUsageCount;
        usageCount = params.usageCount;

        team = params.team;
        executorTeamId = params.executorTeamId;
        approverTeamId = params.approverTeamId;
    }

    function afterInitialized() virtual external onlyExecutee {}

    function executeTransaction(uint256 id) public matchStatus(id, Status.Approved) checkTime(id) onlyExecutor {
        for (uint i = 0; i < transactions[id].data.length; i++) {
            require(allowUnlimitedUsageCount || usageCount > 0, "Exceeded budget usage limit ");
            if (!allowUnlimitedUsageCount) {
                usageCount--;
            }
            _execute(id, transactions[id].data[i]);
        }

        transactions[id].status = Status.Completed;
        emit ExecuteTransaction(id, transactions[id].data, msg.sender);
    }

    function createTransaction(bytes[] memory _data, uint256 _deadline, bool _isExecute) external onlyExecutor returns (uint256) {
        _transactionIds.increment();
        uint256 id = _transactionIds.current();

        // workaround when have mapping in Struct
        Transaction storage newTransaction = transactions[id];
        newTransaction.id = id;
        newTransaction.data = _data;
        newTransaction.deadline = _deadline;
        newTransaction.isExist = true;

        if (minApproval == 0) {
            transactions[id].status = Status.Approved;
        } else {
            transactions[id].status = Status.Pending;
        }

        emit CreateTransaction(id, _data, _deadline,  newTransaction.status);

        if (_isExecute) {
            executeTransaction(id);
        }
        return id;
    }

    function approveTransaction(uint256 id) external onlyApprover {
        require(transactions[id].status == Status.Pending
            || transactions[id].status == Status.Approved,
            "Unexpected transaction status");
        require(!transactions[id].approved[msg.sender], "Transaction has been approved before");

        transactions[id].approved[msg.sender] = true;
        transactions[id].approvedCount++;

        if(transactions[id].approvedCount >= minApproval) {
            transactions[id].status = Status.Approved;
        }

        emit ApproveTransaction(id, msg.sender);
    }

    function revokeTransaction(uint256 id) external onlyExecutor {
        require(transactions[id].status != Status.Completed, "Transaction has been completed before");
        transactions[id].status = Status.Cancelled;

        emit RevokeTransaction(id);
    }

    function statusOf(uint256 id) public view returns (Status) {
        return transactions[id].status;
    }
    function approvedCountOf(uint256 id) public view returns (uint256) {
        return transactions[id].approvedCount;
    }
    function deadlineOf(uint256 id) public view returns (uint256) {
        return transactions[id].deadline;
    }

    function _execute(uint256, bytes memory) internal virtual;
    function executeParams() public pure virtual returns (string[] memory);
    function name() external virtual returns (string memory);

    function _authorizeUpgrade(address) internal override initializer {}
}","keccak256":"0xdecb5b2d46ddde5f74daf100afdf80f278af179a277d385e6a6b2365017744b8","license":"GPL-3.0"},"contracts/base/PriceResolver.sol":{"content":"// SPDX-License-Identifier: GPL-3.0

pragma solidity 0.8.7;
import "@openzeppelin/contracts-upgradeable/token/ERC1155/ERC1155Upgradeable.sol";
import "@openzeppelin/contracts/token/ERC20/extensions/IERC20Metadata.sol";
import "@chainlink/contracts/src/v0.8/Denominations.sol";
import "@chainlink/contracts/src/v0.8/interfaces/FeedRegistryInterface.sol";
import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/utils/Strings.sol";
import "../lib/Constant.sol";

contract PriceResolver is Initializable {
    address public baseCurrency;

    function __PriceResolver_init(address _baseCurrency) internal onlyInitializing {
        baseCurrency = _baseCurrency;
    }

    function assetBaseCurrencyPrice(address asset, uint256 amount) public view returns (uint256) {
        if (asset == baseCurrency)
            return amount;

        if(baseCurrency == Denominations.ETH || baseCurrency == Constant.WETH_ADDRESS) {
            return assetEthPrice(asset, amount);
        }

        if(asset == Denominations.ETH || asset == Constant.WETH_ADDRESS) {
            return ethAssetPrice(baseCurrency, amount);
        }

        address baseCurrencyETHFeed = address(FeedRegistryInterface(Constant.FEED_REGISTRY).getFeed(baseCurrency, Denominations.ETH));
        address assetETHFeed = address(FeedRegistryInterface(Constant.FEED_REGISTRY).getFeed(asset, Denominations.ETH));
        int price = getDerivedPrice(assetETHFeed, baseCurrencyETHFeed, baseCurrencyDecimals());
        if (price > 0) {
            return uint256(price) * amount / 10 ** IERC20Metadata(asset).decimals();
        }
        return 0;
    }

    function ethAssetPrice(address asset, uint256 ethAmount) public view returns (uint256) {
        if (asset == Denominations.ETH || asset == Constant.WETH_ADDRESS)
            return ethAmount;

        (, int price,,,) = FeedRegistryInterface(Constant.FEED_REGISTRY).latestRoundData(asset, Denominations.ETH);

        if (price > 0) {
            return ethAmount * (10 ** IERC20Metadata(asset).decimals()) / uint256(price);
        }

        return 0;
    }

    function assetEthPrice(address asset, uint256 amount) public view returns (uint256) {
        if (asset == Denominations.ETH || asset == Constant.WETH_ADDRESS)
            return amount;

        (, int price,,,) = FeedRegistryInterface(Constant.FEED_REGISTRY).latestRoundData(asset, Denominations.ETH);

        if (price > 0) {
            return uint256(price) * amount / 10 ** IERC20Metadata(asset).decimals();
        }

        return 0;
    }

    function getDerivedPrice(address _base, address _quote, uint8 _decimals)
        internal
        view
        returns (int256)
    {
        require(_decimals > uint8(0) && _decimals <= uint8(18), "Invalid _decimals");
        int256 decimals = int256(10 ** uint256(_decimals));
        ( , int256 basePrice, , , ) = AggregatorV3Interface(_base).latestRoundData();
        uint8 baseDecimals = AggregatorV3Interface(_base).decimals();
        basePrice = scalePrice(basePrice, baseDecimals, _decimals);

        ( , int256 quotePrice, , , ) = AggregatorV3Interface(_quote).latestRoundData();
        uint8 quoteDecimals = AggregatorV3Interface(_quote).decimals();
        quotePrice = scalePrice(quotePrice, quoteDecimals, _decimals);

        return basePrice * decimals / quotePrice;
    }

    function scalePrice(int256 _price, uint8 _priceDecimals, uint8 _decimals)
        internal
        pure
        returns (int256)
    {
        if (_priceDecimals < _decimals) {
            return _price * int256(10 ** uint256(_decimals - _priceDecimals));
        } else if (_priceDecimals > _decimals) {
            return _price / int256(10 ** uint256(_priceDecimals - _decimals));
        }
        return _price;
    }

    function baseCurrencyDecimals() public view returns (uint8) {
        if (baseCurrency == Denominations.ETH) return 18;
        try IERC20Metadata(baseCurrency).decimals() returns (uint8 _decimals) {
            return _decimals;
        } catch {
            return 0;
        }
    }

    function canResolvePrice(address asset) public view returns (bool) {
        if (asset == Denominations.ETH || asset == Constant.WETH_ADDRESS)
            return true;
        try FeedRegistryInterface(Constant.FEED_REGISTRY).getFeed(asset, Denominations.ETH) {
            return true;
        } catch (bytes memory /*lowLevelData*/) {
            return false;
        }
    }
}","keccak256":"0x85b2c0ca0ce3c67f0496056fcb9a3bc29c04133730a28735bbb5af3ee4a860a9","license":"GPL-3.0"},"contracts/interface/IAdam.sol":{"content":"// SPDX-License-Identifier: GPL-3.0
